10. Export
Como complemento del import tenemos a export, que es la nueva sintaxis para exportar variables de un módulo. Antes se usaba modules.exports y lo igualábamos a lo que quisiéramos exportar, por ejemplo:
function tareaImportante(a, b) {
  console.log('Soy tareaImportante')
  return a + b
}

module.exports = tareaImportante

default
Usamos la palabra clave default para exportar algo por defecto, por ejemplo la función anterior:
ES 6ES 5function tareaImportante(a, b) {
  console.log('Soy tareaImportante')
  return a + b
}

export default tareaImportante'use strict';

Object.defineProperty(exports, "__esModule", {
  value: true
});
function tareaImportante(a, b) {
  console.log('Soy tareaImportante');
  return a + b;
}

exports.default = tareaImportante;
O incluso, lo podemos poner todo seguido:
ES 6ES 5export default function tareaImportante(a, b) {
  console.log('Soy tareaImportante')
  return a + b
}'use strict';

Object.defineProperty(exports, "__esModule", {
  value: true
});
exports.default = tareaImportante;
function tareaImportante(a, b) {
  console.log('Soy tareaImportante');
  return a + b;
}
A la hora de importarlo, directamente es el objecto retornado:
import tareaImportante form './tareaImportante'

Exportando múltiples elementos
Con module.exports teníamos que crear un objeto con los distintos elementos y exportarlo:
function parte1() {
  console.log('parte1')
}

function parte2() {
  console.log('parte2')
}

function parte3() {
  console.log('parte3')
}

module.exports = {
  parte1,
  parte2,
  parte3
}

Usando los nuevos módulos, podemos poner un export al lado de la declaración de cada función:
ES 6ES 5export function parte1() {
  console.log('parte1')
}

export function parte2() {
  console.log('parte2')
}

export function parte3() {
  console.log('parte3')
}'use strict';

Object.defineProperty(exports, "__esModule", {
  value: true
});
exports.parte1 = parte1;
exports.parte2 = parte2;
exports.parte3 = parte3;
function parte1() {
  console.log('parte1');
}

function parte2() {
  console.log('parte2');
}

function parte3() {
  console.log('parte3');
}
Cuando lo vayamos a importar, tenemos que especificar qué parte, no lo podemos importar todo de golpe:
import {parte1, parte2, parte3} from './partes'

Si necesitamos importar todos los elementos, usamos otra sintaxis distinta:
import * as partes from './partes'

babel-es6-es7-y-es8/async-y-await.html.body:
11. Async y Await
Esta nueva sintaxis, es una de las mejores novedades que se le están añadiendo al lenguaje. Está inspirado en TypeScript el leguaje de Microsoft.
Código de ejemplo
Como ejemplo, vamos leer el README.md, copiarlo en dos ficheros borrame1.md y borrame2.md y luego eliminarlos. Al finalizar imprimimos "Hecho".
Usando callbacks
var fs = require('fs')

fs.readFile('README.md', function (data) {
  fs.writeFile('borrame1.md', data, function () {
    fs.writeFile('borrame2.md', data, function () {
      fs.unlink('borrame1.md', function () {
        fs.unlink('borrame2.md', function () {
          console.log('Hecho')
        })
      })
    })
  })
})

Mediante el uso de callbacks, nos queda un código a muy anidado, o sea, un callback hell
Usando promesas
const fs = require('fs-promise')

fs.readFile('README.md').then(data => {
  let promises = [
    fs.writeFile('borrame1.md', data),
    fs.writeFile('borrame2.md', data)
  ]
  Promise.all(promises).then(() => {
    let promises = [
      fs.unlink('borrame1.md'),
      fs.unlink('borrame2.md')
    ]
    Promise.all(promises).then(() => {
      console.log('Hecho')
    }).catch(err => {
      throw err
    })
  }).catch(err => {
    throw err
  })
}).catch(err => {
  throw err
})

Usando promesas nos queda un código menos anidado, pero aún así es bastante complicado, sobretodo respecto al manejo de excepciones.
Usando iteradores
const fs = require('fs-promise')
const gensync = require('../other/generatorsUtils')

const asyncFunc = gensync(function* () {
  const data = yield fs.readFile('README.md')
  yield Promise.all([
    fs.writeFile('borrame1.md', data),
    fs.writeFile('borrame2.md', data)
  ])
  yield Promise.all([
    fs.unlink('borrame1.md'),
    fs.unlink('borrame2.md')
  ])
  yield 'Hecho'
});

asyncFunc().then(console.log)

Esto es un pequeño truco que podemos usar mediante las funciones genradoras. Como podemos ver, el código nos queda casi perfecto. Normalmente si queremos usar esto, usamos una librería como co
async y await
Por último, tenemos la nueva sintaxis, que ya está disponible en node usando la flag --harmony.
async se usa para declarar una función asíncrona, y await para esperar a que se resuelva una promesa.
ES 6ES 5const fs = require('fs-promise')

async function asyncFunc() {
  const data = await fs.readFile('README.md')
  await Promise.all([
    fs.writeFile('borrame1.md', data),
    fs.writeFile('borrame2.md', data)
  ])
  await Promise.all([
    fs.unlink('borrame1.md'),
    fs.unlink('borrame2.md')
  ])
  return 'Hecho'
}

asyncFunc().then(console.log).catch(console.error)'use strict';

var asyncFunc = function () {
  var _ref = _asyncToGenerator(regeneratorRuntime.mark(function _callee() {
    var data;
    return regeneratorRuntime.wrap(function _callee$(_context) {
      while (1) {
        switch (_context.prev = _context.next) {
          case 0:
            _context.next = 2;
            return fs.readFile('README.md');

          case 2:
            data = _context.sent;
            _context.next = 5;
            return Promise.all([fs.writeFile('borrame1.md', data), fs.writeFile('borrame2.md', data)]);

          case 5:
            _context.next = 7;
            return Promise.all([fs.unlink('borrame1.md'), fs.unlink('borrame2.md')]);

          case 7:
            return _context.abrupt('return', 'Hecho');

          case 8:
          case 'end':
            return _context.stop();
        }
      }
    }, _callee, this);
  }));

  return function asyncFunc() {
    return _ref.apply(this, arguments);
  };
}();

function _asyncToGenerator(fn) { return function () { var gen = fn.apply(this, arguments); return new Promise(function (resolve, reject) { function step(key, arg) { try { var info = gen[key](arg); var value = info.value; } catch (error) { reject(error); return; } if (info.done) { resolve(value); } else { return Promise.resolve(value).then(function (value) { step("next", value); }, function (err) { step("throw", err); }); } } return step("next"); }); }; }

var fs = require('fs-promise');

asyncFunc().then(console.log).catch(console.error);
Una función asíncrona siempre devuelve una promesa, que se resuelve con el return y se rechaza mediante un throw.

babel-es6-es7-y-es8/integracion-con-expr.body:
13. Integración con Express
Otro ejemplo de uso de Babel, es con Express. Cuando queremos consultar la base de datos podemos tener muchas operaciones asíncronas, y con async y await nos queda mucho más simple.
import { router } from 'express'
import { User } from './models'

router.post('/users/create', async (req, res) => {
  let { email, password } = req.body
  if (await User.find({email})) {
    return res.status(400).send('Ese correo ya existe')
  }
  let user = new User({email, password})
  await user.save()
  res.send('Te has registrado correctamente')
})

