canvas/lineas_curvas.html.body:
3. Líneas y curvas
Líneas
Para dibujar líneas con canvas se utilizan los siguientes métodos:

beginPath(): Método para declarar que estamos a punto de trazar un nuevo camino.

context.beginPath();


moveTo(): Posicionar el punto de comienzo.

ctx.moveTo(10,10);


lineTo(): Dibujar la línea recta desde la posición inicial hasta la nueva posición.

ctx.lineTo(190,90);


stroke(): Dibujar la línea, hacerla visible. A menos que se especifique, el color por defecto es negro.

ctx.stroke();


lineWidth: Establecer un ancho a la línea.

ctx.lineWidth = 10;


strokeStyle: Establecer un color.

ctx.strokeStyle = '#FF5733';


lineCap: Establecer un formato para el tope de la línea, pueden ser: 'butt', 'round' y 'square' (extremo, redondo o cuadrado).

ctx.lineCap ='round'

Estas propiedades se deben establecer antes de llamar a stroke().
En el siguiente código se aplican las funciones anteriores:





        //Inicializar el elemento canvas.
          var c=document.getElementById("myCanvas");
          var ctx=c.getContext("2d");
          ctx.moveTo(10,10);
          ctx.lineTo(190,90);
          ctx.lineWidth = 10;
          ctx.strokeStyle = '#FF5733';
          ctx.lineCap ='round'
          ctx.stroke();




Elemento canvas:


Curvas
Arco

arc(): Los arcos se definen por un punto central, un radio, un ángulo inicial, un ángulo final y la dirección de dibujo. Los arcos se pueden diseñar con las propiedades lineWidth, strokeStyle y lineCap.


Ejemplo 1:
Para crear una curva hemos establecido el ángulo de inicio en 0 y el ángulo final en 2 * Math.PI.
Los parámetros x,y definen las coordenadas x,y del centro del círculo.
El parámetro r define el radio del círculo.
ctx.arc(x,y,r,angulo_inicio,angulo_fin)
ctx.arc(50,50,40,0,2*Math.PI);

Ejemplo 2:







      var canvas = document.getElementById('myCanvas');
      var ctx = canvas.getContext('2d');
      var x = canvas.width / 2;
      var y = canvas.height / 2;
      var radius = 75;
      var startAngle = 1.1 * Math.PI;
      var endAngle = 1.9 * Math.PI;
      var counterClockwise = false;

      ctx.beginPath();
      ctx.arc(x, y, radius, startAngle, endAngle, counterClockwise);
      ctx.lineWidth = 15;

      ctx.strokeStyle = '#FF5733';
      ctx.lineCap ='round'
      ctx.stroke();





Curva cuadrática

quadraticCurveTo(): Las curvas cuadráticas se definen por el punto medio, un punto de control y un punto final. Las curvas cuadráticas se pueden diseñar con las propiedades lineWidth, strokeStyle y lineCap.


Ejemplo:





      var canvas = document.getElementById('myCanvas');
      var ctx = canvas.getctx('2d');

      ctx.beginPath();
      ctx.moveTo(188, 150);
      ctx.quadraticCurveTo(288, 0, 388, 150);
      ctx.lineWidth = 10;

      // line color
      ctx.strokeStyle = '#FF5733';
      ctx.lineCap ='round'
      ctx.stroke();

canvas/texto.html.body:
4. Texto
Funciones
Para dibujar texto en el elemento canvas, se utiliza la propiedad font y el método fillText().

font: Método para establecer la fuente, el tamaño y el estilo del texto, a una cadena que contenga el estilo, el tamaño y la familia de la fuente, delimitados por espacios. El estilo puede ser normal, cursiva o negrita. A menos que se especifique lo contrario, el estilo de fuente es predeterminado como normal.
context.font = 'italic 40pt Calibri';


fillText(): Método para dibujar el texto, requiere una cadena y las coordenadas x e y donde queremos colocar el texto en el canvas.
context.fillText('Hello World!', 150, 100);


fillStyle: Propiedad para aplicarle un color al texto que hemos dibujado.
context.fillStyle = 'blue';


strokeText: Propiedad para dibujar el texto sin relleno en el elemento canvas. Al igual que el método 'fillText()', a 'strokeStyle' le pasamos el texto y las coordenadas (x,y) de su posición.
ctx.strokeText("Sistemas y...",10,40);


textAlign: Propiedad para alinear el texto dentro del elemento canvas, se puede configurar para situarlo en el inicio, el final, el centro, la izquierda o la derecha.
La alineación es relativa a una línea vertical imaginaria en la posición x del texto que hemos definido anteriormente.
Si no se especifica, la propiedad 'textAlign' está predeterminada para la posición inicial (ajustada a la derecha).
ctx.textAlign = 'center';


measureText: Propiedad para obtener las métricas del texto que hemos introducido. Esta propiedad puede resultar útil a la hora de diseñar un elemento y que se desee controlar de manera precisa el tamaño que ocupa el texto, por ejemplo.
var metrics = context.measureText(text);


wrapText: Esta propiedad permite ajustar el texto en el elemento canvas, para ello, se puede crear una función personalizada que deberá requerir el contexto (ctx) del canvas, posición, ancho máx y altura. También será necesario el uso de 'measureText' para el cálculo de cuándo debe encajar la siguiente línea.
wrapText(ctx, text, x, y, maxWidth, lineHeight);



Ejemplo práctico





          var canvas=document.getElementById("myCanvas");
          var ctx=canvas.getContext("2d");

          ctx.font="30px Arial";
          // Texto con relleno...
          ctx.fillText("Tecnologias...",20,70);
          // Texto sin relleno
          ctx.strokeText("Sistemas y...",10,40);

          // Texto en el centro del Canvas.
          ctx.font="30px Comic Sans MS";
          ctx.fillStyle="red";
          ctx.textAlign="center";
          ctx.fillText("Web", canvas.width/2, canvas.height/2);

canvas/imagenes.html.body:
5. Imágenes
Funciones
En un elemento canvas podemos dibujar imágenes utilizando las siguientes funciones:

drawImage(): Este método requiere un objeto de imagen y un punto de destino. Este punto define la esquina superior izquierda de la imagen en relación con la esquina superior del canvas.
  Dado que el método drawImage () requiere un objeto de imagen, primero debemos crear una imagen antes de instanciar 'drawImage()''.
  var img = new Image();
  img.src = 'ruta de la imagen'
  ctx.drawImage(img, 69, 50);


Tamaño de la imagen: Al método anterior, drawImage, se le añaden dos argumentos adicionales que indican la altura y el ancho (width, height) de la imagen.
ctx.drawImage(img, 69, 50, width, height);


Recortar la imagen: Para recortar un rectángulo concreto de la imagen que se ha cargado se agregarán seis nuevos argumentos adicionales al método 'drawImage' que delimitarán el rectángulo que se desea mostrar.

sourceX.
sourceY.
sourceHeight.
sourceWidth.

context.drawImage(imageObj, sourceX, sourceY, sourceWidth, sourceHeight, destX, destY, destWidth, destHeight);



