{
  Animales.insert({
    Nombre: "Tigre",
    Familia: "Felinos",
    Tipo: "Mamífero carnívoro"
  });
  Animales.insert({
    Nombre: "Tiburón",
    Familia: "Pez cartilaginoso",
    Tipo: "Carnívoro"
  });
  //.........
}

