5. HTML Template
HTML Template, es una característica fundamental para crear tu propio elemento en Polymer. Con la etiqueta  se puede llamar al elemento y acceder a todas sus característica mediante javascript. Estos elementos propios, se encuentran almacenados en otros ficheros .html que no son el index.html.
La estructura típica de un elemento creado por un usuario es la siguiente





        /*CSS rules for the element*/

      Hello :)





Polymer({
    is: 'hello-world',
    properties: {
        who: {
            type: String,
            value: 'World'
        }
    }
});


Como se puede apreciar, se trata de un simple hola mundo utilizando nuestro propio elemento. Para poder hacerlo funcional, lo primero que hay que realizar es la importación del componente polymer que se encuentra en bower_components/polymer. A continuación, se utiliza  la etiqueta  que permitirá que se carguen todas las características que posee el elemento creado en el Local DOM.
Finalmente, mediante el script y la llamada a Polymer is: 'nombreElemento' se permitirá que desde cualquier fichero .html se llame al elemento creado utilizando únicamente la etiqueta    e importando el archivo html donde se encuentre .

polymer/shadyDom.html.body:
8. Qué es el Shady Dom
Como ya se comentó anteriormente, el shadow Dom es una de las características principales para la creación de web components pero, el uso del shadow dom si no se es un desarrollador experimentado es tedioso y complicado de usar.
Polymer, además de trabajar con el shadow dom, también permite trabajar con lo que se le denomina Shady DOM. El shady dom, permite acceder al arbol dom que se crea del componente de una manera más facil que como se haría utilizando el shadow dom.
Uso del this.$
Para acceder a los elementos del DOM de el elemento creado sólo basta con acceder mediante la utilización de la sentencia this.$.identificador del elemento a acceder. A continuación, se muestra un ejemplo práctico del uso del shady DOM





      Luke Skywalker

        especie: humana
        planeta natal: Tatooine
        ocupación: maestro jedy




  Polymer({
    is: "star-wars"
  });



Para acceder al elemento con id specie por ejemplo, habría que áñadir la siguiente sentencia
nombrefuncion: function () {
  this.$.specie.style.color="#123456"
}

Esto permitirá de una manera simple acceder a cualquier nodo de nuestro elemento simplemente utilizando this.$.id , haciendo mucho más fácil la modificación del nodo de nuestro elemento el arbol local que se crea.
Uso del this.$$
La sentencia this.$ funciona cuando el nodo está incluído dentro del template del elemento que se esta creando. En caso de que se quiera acceder al nodo de un elemento que se cree  posteriormente dentro de una función por ejemplo, habría que añadir la sentencia this.$$.(id del nodo). A continuación, se muestra un ejemplo claro de cómo funcionaría this.$$ .
  nombrefuncion: function() {
    var item = document.createElement('li');
    item.innerHTML = "notas: su padre es Darth Vader";
    Polymer.dom(this.$.description).appendChild(item);
  }

Polymer para crear nodos dentro de un elemento posee su propia API y tiene una serie de funciones que se detallan en Polymer.dom. En esta ocasión, se está creando un elemento del tipo li que es hijo del nodo description y que lo que hace es mostrar una información con respecto a lo que contiene ese elemento.
En esta ocasión, si se quisiera utilizar la sentencia  this.$.notes.style.color="#123456" daría error, ya que el nodo no está creado en el template como tal sino que está creado posteriormente. Para modificar el nodo, se debe utilizar la sentencia this.$$("#notes").style.color = "#123456"

polymer/behaviors.html.body:
10. Qué es un behavior
Un behavior, es la manera de extender un custom element para compartir el código entre diferentes componentes de Polymer. Esta manera de compartir código permite añadir nuevas características al componente que se este desarrollando utilizando lo que otro desarrollador haya realizado en un componente totalmente distinto.
Para añadir un behavior a un elemento que se está creando, se tiene que añadir las siguientes líneas.
Polymer({
  is: 'nombreElemento',
  behaviors: [SuperBehavior]
});

En caso de que como desarrollador se quiera crear un propio behavior, sólo hay que crear un nuevo documento html mi-behavior.html el cual sólo contendrá código javascript para añadir las funciones que se exportarán a los elementos que usen el behavior. La sintaxis para crear un behavior estándar es poner como mayúscula la primera letra del mismo. A continuación, se muestra un ejemplo de la creación de un behaviour.

ValidadorBehavior = {
  esdni: function(dni) {
    if(dni.length  100)
      return false;
    return true;
  }
};


Este behavior permite comprobar que si los datos que se introducen de una persona (nombre y dni) son correctos. Para añadir este behavior en un elemento que se esté desarrollando, se debe añadir en otro fichero html la siguiente estructura.



      /*Añaidr el estilo al componente*/




    Polymer({
      is: 'formulario-registro',
      behaviors: [ValidadorBehavior],
      properties: {
        name: String,
        dni: String
      },
      saveUser: function() {
        if(this.esName(this.name) && this.esdni(this.dni)) {
          //se comprueba el nombre y el DNI/NIE mediante los métodos del behavior
        }
      }
    });



Además, aunque no se muestra en el ejemplo anterior,los behavior también permiten añadir funciones de eventos listeners,observers, etc. sólo habría que añadir como función o como propiedad las siguientes líneas.

  HighlightBehavior = {
    properties: {
      isHighlighted: {
        type: Boolean,
        value: false,
        notify: true,
        observer: '_highlightChanged'  //se añade el evento como propiedad
      }
    },
    //se añade el evento como función del behavior
    listeners: {
      click: '_toggleHighlight'
    }
  };

polymer/vulcanize.html.body:
11. Vulcanize o vulcanizado
Cuando en Polymer se dispone de un fichero html donde se importa una gran cantidad de ficheros externos y se está en fase de producción, al realizarse la búsqueda de todos los ficheros importados, se produce un coste muy alto de búsqueda en el navegador. Para evitar que esto se produzca, se utiliza la herramienta del vulcanizado o vulcanize.
La herramienta vulcanize, permite añadir todos esos ficheros html que se importan y las etiquetas  que se añaden, en un único fichero para mejorar el tiempo de búsqueda en fase de producción.
Para instalar vulcanize, se necesita la herramienta npm
npm install -g vulcanize
Para conseguir que todos los ficheros htmls, las hojas de estilo y los scripts que se importan y agregarlos en un único fichero html, se utiliza el siguiente comando
vulcanize --inline-scripts --inline-css --strip-comments \
    elements.html > elements.build.html

Gulp y Vulcanize
Para realizar la automatización de todas estas tareas, se utiliza un fichero gulpfile con la tarea vulcanize. La tarea en el fichero gulpfile debería ser similar a las siguiente líneas
var gulp = require('gulp');
var vulcanize = require('gulp-vulcanize');
gulp.task('vulcanize', function() {
  return gulp.src('app/elements/elements.html')
    .pipe(vulcanize({
      stripComments: true,
      inlineScripts: true,
      inlineCss: true
    }))
    .pipe(gulp.dest('dist/elements'));
});

Ejemplo práctico
Acontinuación se muestra un ejemplo práctico que se encuentra en el siguiente enlace Ejemplo vulcanize








   ...











    Hello from x-foo!


    Polymer({
      is: 'x-foo'
    });







    Hello from x-bar!


    Polymer({
      is: 'x-bar'
    });



El resultado al realizar el vulcanize del fichero elements.html (que es el que posee la importación de los elementos) mediante la siguiente línea vulcanize elements.html -o elements.vulcanized.html es el siguiente


    Hello from x-foo!


    Polymer({is: 'x-foo'});




    Hello from x-bar!


    Polymer({is: 'x-bar'});
